const Podcasts = () => {
  return (
    <div className="podcasts-page">
      <i
        id="podcast"
        className="fas fa-podcast"
        style={{ fontSize: "50px" }}
      ></i>
      <h1 id="podcast1">Podcasts youâ€™ve liked live here</h1>
      <h6 id="podcast2">Looking for something new?</h6>
      <button id="podcast-icon">PODCASTS</button>
    </div>
  );
};
export default Podcasts;
